import React from 'react';

const Menu = () => {


    const nombreMen = 1;

    function handleClick(e) {
        e.preventDefault();
        nombreMen=5;
        console.log('cambiarMenu aca: ' + nombreMen);
    }

    return (
        <header className="app-menu">
            <nav className="nav-principal">
                 <a href="#">Equipo</a>
            </nav>
            <a href="#"
                onClick = {handleClick}>Jugadores
            </a>
            <a href="#">Plantel</a>
            <a href="#">Partidos</a>
            <a href="#">Formacion</a>
            <a href="#">Entrenamientos</a>
            <a href="#">Reportes</a>
        </header>
    );
}
export default Menu;
